import React from "react";
import { Container, Row, Col } from "react-bootstrap";
import { NavLink } from "react-router-dom";

export function Footer() {
return (
  <>
<Container>
  <Row>
    <Col className="bg-white shadow-sm" style={{ height: "100px"}}>
  <footer className="d-flex align-item-center" style={{ textDecoration: "none" }}>
    <div>
    <NavLink to="/" className="p-3"  style={{ textDecoration: "none" }}>Store
    </NavLink>
    <NavLink to="/contact"className="p-3"   style={{ textDecoration: "none" }}>Contact</NavLink>
    <NavLink to="/shoppingcart"  style={{ textDecoration: "none" }}>Cart</NavLink>
    <strong>Ecommerce @ 2023</strong>
    </div>
    </footer>
  </Col>
  </Row>
  </Container>
  </>
)
}

export default Footer;
